def dc(encrypted:str, key:str):
	hashedKey = hashlib.sha512(str.encode(key+"9Rk3ndsalt")).digest() + hashlib.sha3_512(str.encode("saltf59NVRf6be2"+key)).digest()
	iMax = len(hashedKey)
	i = 0
	decrypted = ""
	for n in encrypted:
		i += 1
		decrypted += chr( ( (n ^ (hashedKey[i%iMax] * hashedKey[3*i%iMax] - hashedKey[11*i%iMax])) - hashedKey[7*i%iMax] ) // (1+hashedKey[5*i%iMax]) )
	return decrypted

